import React from 'react'


const attributes = {
    str: 0,
    constitution: 0,
    dexterity: 0
}

class Hero extends React.Component() {
    constructor(props) {
        super(props);
        this.str = this.props.str;
        this.constitution = this.props.constitution;
        this.dexterity = this.props.dexterity;
    }
    render() {
        return (
            <div>
                <p>Str = {this.str}</p>
                <p>Constitution = {this.constitution}</p>
                <p>Dexterity={this.dexterity}</p>
            </div>
        );
    }
}

export default Hero;
